INSERT INTO `realhome_postmeta` VALUES ('1401', '63', 'short_content', 'Công ty cổ phần tư vấn thiết kế kiến trúc. EMAAR DECOR là đơn vị hàng đầu trong lĩnh vực thiết kế và thi công nội, ngoại thất.');
INSERT INTO `realhome_postmeta` VALUES ('1402', '63', '_short_content', 'field_5aa8d009196ea');
INSERT INTO `realhome_postmeta` VALUES ('1403', '70', 'short_content', 'Tư vấn đầu tư vào các dự án căn hộ, chung cư cao cấp, nhà đất.');
INSERT INTO `realhome_postmeta` VALUES ('1404', '70', '_short_content', 'field_5aa8d009196ea');
INSERT INTO `realhome_postmeta` VALUES ('1405', '71', 'short_content', 'Với những nghệ nhân, thợ thủ công lành nghề đến từ Lâm Đồng, Bảo Lộc, Bắc Ninh, Huế… xưởng gỗ. EMAAR DECOR đã tạo ra những sản phẩm đồ gỗ hoàn hảo và độc đáo.');
INSERT INTO `realhome_postmeta` VALUES ('1406', '71', '_short_content', 'field_5aa8d009196ea');
INSERT INTO `realhome_postmeta` VALUES ('1407', '72', 'short_content', 'Trong bối cảnh không ít kênh đầu tư đang có dấu hiệu chững lại hoặc cho kết quả âm thì bất động sản nói chung và phân khúc biệt thự nghỉ dưỡng, biệt thự biển nói riêng lại đang mang về niềm vui lớn cho những người có trong tay một khoản tiền vừa phải');
