INSERT INTO `realhome_posts` VALUES ('63', '1', '2017-10-20 03:53:25', '2017-10-20 03:53:25', '<span style=\"font-family: arial, helvetica, sans-serif; color: #000000;\">Công ty cổ phần tư vấn thiết kế kiến trúc <span style=\"color: #003366;\">EMAAR DECOR</span> là đơn vị hàng đầu trong lĩnh vực thiết kế và thi công nội, ngoại thất.</span>\r\n\r\n<span style=\"font-family: arial, helvetica, sans-serif; color: #000000;\">Trải qua một quá trình phát triển, <span style=\"color: #003366;\">EMAAR DECOR</span> tự hào là đơn vị hàng đầu khi nhận được sự tín nhiệm của đông đảo khách hàng trên địa bàn Tp. Hồ Chí Minh và các tỉnh lân cận. Để đáp ứng nhu cầu thi công nội thất ngày càng cao của khách hàng, <span style=\"color: #003366;\">EMAAR DECOR</span> đã tiến hành xây dựng nhiều xưởng sản xuất gỗ trên địa bàn Tp. Hồ Chí Minh, trang bị đầy đủ các trang thiết bị hiện đại như: máy trượt cắt ván 2 lưỡi, máy dán chỉ tự động, máy phây…</span>', 'Tư vấn, thiết kế kiến trúc', '', 'publish', 'closed', 'closed', '', 'thiet-ke-thi-cong-hoan-thien-noi-that', '', '', '2018-03-14 07:41:09', '2018-03-14 07:41:09', '', '0', 'http://localhost/realhome/?post_type=service&#038;p=63', '0', 'service', '', '0');
