INSERT INTO `realhome_posts` VALUES ('70', '1', '2017-10-20 03:55:50', '2017-10-20 03:55:50', 'Tư vấn đầu tư vào các dự án căn hộ, chung cư cao cấp, nhà đất.', 'Tư vấn đầu tư Dự án Căn hộ', '', 'publish', 'closed', 'closed', '', 'tu-van-dau-tu-du-an-can-ho', '', '', '2018-03-14 07:36:36', '2018-03-14 07:36:36', '', '0', 'http://localhost/realhome/?post_type=service&#038;p=70', '1', 'service', '', '0');
INSERT INTO `realhome_posts` VALUES ('71', '1', '2017-10-20 03:57:50', '2017-10-20 03:57:50', '<span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"color: #000000;\">Với những nghệ nhân, thợ thủ công lành nghề đến từ Bảo Lộc, Lâm Đồng, Vĩnh Long, Bắc Ninh, Huế,... xưởng gỗ</span> <span style=\"color: #003366;\">EMAAR DECOR</span> <span style=\"color: #000000;\">đã tạo ra những sản phẩm đồ gỗ hoàn hảo và độc đáo.</span></span>\r\n\r\n<span style=\"font-family: arial, helvetica, sans-serif; color: #000000;\">Nguồn vật liệu của <span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"color: #003366;\">EMAAR DECOR</span></span> chủ yếu là những loại gỗ tự nhiên bao gồm: Xoan đào, Ash Mỹ, căm xe, hương, gõ,…đều được sấy và xử lý theo quy trình nghiêm ngặt, chống mối mọt. Ngoài ra, các loại ván ép như: <span style=\"color: #003366;\"><em>MFC, MDF, HDF, MDF Verneer,…</em></span> cũng được sử dụng để tạo nên những vật dụng hiện đại và sang trọng.</span>\r\n<span style=\"font-family: arial, helvetica, sans-serif; color: #000000;\"> Nhờ những yếu tố vượt trội đó, <span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"color: #003366;\">EMAAR DECOR</span></span> đã thực hiện rất nhiều dự án tại các khu đô thị cao cấp như: <span style=\"color: #003366;\"><em>Vinhomes Central Park, Sunrise City, Saigon Pearl, Thảo Điền Pearl, Happy Valley, The Tresor, Galaxy 9, Icon 56, Star Hill, Him Lam, Masteri Thảo Điền, The Prince Residence,…</em></span></span>\r\n\r\n<span style=\"font-family: arial, helvetica, sans-serif; color: #000000;\">Hiện nay, <span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"color: #003366;\">EMAAR DECOR</span></span> vẫn tiếp tục là thương hiệu hàng đầu được nhiều gia đình lựa chọn để mang lại chất lượng, sự đẳng cấp và sang trọng cho không gian sống của gia đình bạn.</span>', 'Thi công hoàn thiện Nội Thất', '', 'publish', 'closed', 'closed', '', 'thi-cong-hoan-thien-noi-that', '', '', '2018-03-14 07:46:52', '2018-03-14 07:46:52', '', '0', 'http://localhost/realhome/?post_type=service&#038;p=71', '2', 'service', '', '0');
INSERT INTO `realhome_posts` VALUES ('72', '1', '2017-10-20 03:59:15', '2017-10-20 03:59:15', 'Các kênh đầu tư hiện nay bao gồm gửi tiết kiệm ngân hàng với lãi suất tiền việt dao dộng từ 5 tới 7%/năm và còn canh cánh trong lòng nỗi lo trượt giá. Đầu tư vàng hay ngoại tệ, chứng khoán không còn là sự lựa chọn số 1 khi biến động giảm liên tục, khả năng lướt sóng đầu tư không còn. Nhà phố hay chung cư bình dân không còn sở hữu lợi thế thanh khoản và sinh lời cao khi mà nguồn cung các dự án mới ra mắt liên tục, khách hàng đều có cơ hội mua trực tiếp từ Chủ đầu tư. Đầu tư nhà phố, chung cư bình dân cho thuê cũng đang mất dần vị trí là kênh đầu tư số 1 khi lượng nhà cho thuê quá nhiều, giá thuê thấp dần, công suất cho thuê không ổn định đã khiến mức sinh lời trung bình của kênh này chỉ ở mức 3.8%/năm.\r\nTrong khi đó, Căn hộ khách sạn (Condotel) cũng như Biệt thự nghỉ dưỡng đưa ra chính sách chia sẻ với chủ sở hữu 70% - 85% lợi nhuận từ việc kinh doanh cho thuê lại căn hộ khách sạn/Biệt thụ nghỉ dưỡng trọn đời và đây là số tiền khách hàng thực nhận sau khi đã trừ đi toàn bộ chi phí vận hành, quản lý. \r\n\r\nVingroup hiện nay là Chủ đầu tư duy nhất đưa ra cam kết đảm bảo lợi nhuận kinh doanh Condotel tối thiểu 10%/năm cho khách hàng trong 5 năm và cam kết đảm bảo lợi nhuận kinh doanh Biệt thự nghỉ dưỡng tối thiểu 10%/năm cho khách hàng trong 10 năm.\r\n', 'Đầu tư Biệt thự biển, Condotel', '', 'publish', 'closed', 'closed', '', 'dau-tu-biet-thu-bien-condotel', '', '', '2018-03-14 08:03:30', '2018-03-14 08:03:30', '', '0', 'http://localhost/realhome/?post_type=service&#038;p=72', '3', 'service', '', '0');
