INSERT INTO `realhome_posts` VALUES ('131', '1', '2017-10-27 04:30:58', '2017-10-27 04:30:58', 'Thành phố Hồ Chí Minh là thành phố lớn nhất Việt Nam về dân số và kinh tế, đứng thứ hai về diện tích, đồng thời cũng là một trong những trung tâm kinh tế và văn hóa, giáo dục quan trọng nhất của nước này.', 'Thành phố Hồ Chí Minh', '', 'publish', 'closed', 'closed', '', 'thanh-pho-ho-chi-minh', '', '', '2018-03-13 06:33:35', '2018-03-13 06:33:35', '', '0', 'http://localhost/realhome/?post_type=area&#038;p=131', '0', 'city', '', '0');
INSERT INTO `realhome_posts` VALUES ('133', '1', '2017-10-27 04:31:52', '2017-10-27 04:31:52', 'Hà Nội là thủ đô của nước Cộng hoà xã hội chủ nghĩa Việt Nam và cũng là kinh đô của hầu hết các vương triều phong kiến Việt trước đây. Do đó, lịch sử Hà Nội gắn liền với sự thăng trầm của lịch sử Việt Nam qua các thời kỳ', 'Hà Nội', '', 'publish', 'closed', 'closed', '', 'ha-noi', '', '', '2018-03-13 06:37:54', '2018-03-13 06:37:54', '', '0', 'http://localhost/realhome/?post_type=area&#038;p=133', '0', 'city', '', '0');
INSERT INTO `realhome_posts` VALUES ('135', '1', '2017-10-27 04:32:40', '2017-10-27 04:32:40', 'Đà Nẵng là một thành phố thuộc trung ương từ năm 1997, nằm trong vùng Nam Trung Bộ, Việt Nam, là trung tâm kinh tế, tài chính, chính trị, văn hoá, du lịch, xã hội, giáo dục, đào tạo, khoa học và công nghệ, y tế chuyên sâu của khu vực miền Trung - Tây Nguyên và cả nước. Đà Nẵng là thành phố lớn và quan trọng nhất miền Trung, đồng thời cũng là một trong 5 thành phố trực thuộc Trung ương ở Việt Nam,[2] đô thị loại 1 trung tâm cấp quốc gia, cùng với Hải Phòng và Cần Thơ.', 'Đà Nẵng', '', 'publish', 'closed', 'closed', '', 'da-nang', '', '', '2018-03-13 06:37:30', '2018-03-13 06:37:30', '', '0', 'http://localhost/realhome/?post_type=area&#038;p=135', '0', 'city', '', '0');
INSERT INTO `realhome_posts` VALUES ('136', '1', '2017-10-27 04:33:37', '2017-10-27 04:33:37', 'Nha Trang là một thành phố ven biển và là trung tâm chính trị, kinh tế, văn hóa, khoa học kỹ thuật và du lịch của tỉnh Khánh Hòa, Việt Nam. Trước khi trở thành phần đất của Việt Nam, Nha Trang thuộc về Chiêm Thành.', 'Nha Trang', '', 'publish', 'closed', 'closed', '', 'nha-trang', '', '', '2018-03-13 06:37:08', '2018-03-13 06:37:08', '', '0', 'http://localhost/realhome/?post_type=area&#038;p=136', '0', 'city', '', '0');
